html/event/HTMLEvent.html.body:
HTML - HTMLEvent
Event 인터페이스는 DOM의 모든 Event를 표현합니다.
일부는 마우스나 키보드 등 사용자가 유도하는 Event고, 일부는 애니메이션 종료와 비디오 일시정지 등 API에서 발생합니다.
많은 종류의 Event가 존재하고, 몇몇은 Event 인터페이스에 기반한 다른 인터페이스를 사용합니다. Event 자체는 모든 Event 공통의 속성과 메서드를 가지고 있습니다.

전역에 선언되어있는 Event 종류들(TypeScript)
interface Event { }
interface AnimationEvent extends Event { }
interface ClipboardEvent extends Event { }
interface CompositionEvent extends Event { }
interface DragEvent extends Event { }
interface FocusEvent extends Event { }
interface KeyboardEvent extends Event { }
interface MouseEvent extends Event { }
interface TouchEvent extends Event { }
interface PointerEvent extends Event { }
interface TransitionEvent extends Event { }
interface UIEvent extends Event { }
interface WheelEvent extends Event { }



Event Properties

event.target (Read only)
이벤트가 최초로 Dispatch 된 Target 참조입니다.


event.currentTarget (Read only)
이벤트에 대해 현재 등록 된 대상에 대한 참조입니다. 이것은 이벤트가 현재 전송 될 예정인 객체입니다.


event.type (Read only)
Event의 이름입니다. 대소문자를 구분하지 않습니다.


event.returnValue
기존 사이트가 계속 작동하도록 Internet Explorer에서 도입되고 DOM 사양에 채택 된 역사적 속성, 이상적으로는 대신 event.preventDefault() 및 event.defaultPrevented를 사용하려고 시도해야하지만 returnValue를 사용하여 그렇게 할 수 있습니다.


event.cancelable (Read only)
Event를 취소할 수 있는지 나타내는 불린 값입니다.


event.cancelBubble
event.stopPropagation ()의 기록 별칭입니다. 이벤트 핸들러에서 리턴되기 전에 값을 true로 설정하면 이벤트 전파가 방지됩니다.


event.eventPhase (Read only)
처리중인 이벤트 흐름의 단계를 나타냅니다.




추가적인 Dom Event 속성에 대해서 보고싶으시면 아래 주소를 클릭해주세요.

HTML - Dom Event Properties


- event.target
Event는 다른 Element에 전파되어도 Event의 근원이 정확히 어디서 발생되었는지를 알 수 있습니다. 이러한 정보를 가지고 있는 것이 바로 event.target입니다.
- event.currentTarget
Event의 currentTarget은 Event의 근원(event.target)과는 다릅니다.
Event는 항상 전파되는 속성을 갖고 있기 때문에, 현재 Event가 전파되어 작동되는 Event가 다르기 때문입니다.
이렇게 전파되고 있는 Event가 어디에 위치하였는지에 대한 정보를 알기 위해 currentTarget이란 속성을 사용할 수 있습니다.

event.target & event.currentTarget Example



- event.type
현재 Event가 어떠한 type으로 동작하는지를 알 수 있습니다.
예를 들어, addEventListener('click', ...) 혹은, Hello처럼 Event가 할당된다면 type은 'click'이란 정보를 저희에게 제공해줄 것입니다.
- event.cancelable
이벤트를 취소할 수 있는 가능여부에 따라 true 또는 false가 됩니다.
const isCancelable = event.cancelable; // true or false

- event.cancelBubble
cancelBubble는 기본값이 false이며, true로 할 경우 event.stopPropagation()과 같은 효과로 이벤트 전파(버블링)를 취소할 수 있습니다.
const button = document.getElementById('#Button');
button.onclick = function(event) {
    event.cancelBubble = true;
}

- event.eventPhase
eventPhase는 이벤트 핸들러가 호출된 단계입니다. 값으로서 1은 캡처링 2는 타겟, 3은 버블링 단계입니다.
const button = document.getElementById('#Button');
button.onclick = function(event) {
    alert(event.eventPhase); // 2
}
button.addEventListener('onclick', function(event) {
    alert(event.eventPhase); // 1
}, true);
button.addEventListener('onclick', function(event) {
    alert(event.eventPhase); // 3
});

- event.returnValue
returnValue는 기본값이 true이며, false 할 경우 event.preventDefault()과 같은 효과로 이벤트 전파를 취소할 수 있습니다.
const button = document.getElementById('#Button');
button.onclick = function(event) {
    event.returnValue = false;
}


Event properties Examples




Event Methods
- Method : event.prevnetDefault()
Event를 취소할 수 있는 경우, Event의 전파를 막지않고 그 Event를 취소합니다. Event를 취소할 수 없는 경우(cancelable = false)는 작동되지 않습니다.
특히, HTML Tag마다 기본적인 Event가 존재하는데(예, 'A' Tag에서 href로 인한 페이지이동) 이러한 기본적으로 존재하는 Event를 취소하는데 사용됩니다.

Event를 취소하는 도중에 preventDefault를 호출하게되면, 일반적으로는 브라우저의 구현에 의해 처리되는 기존의 액션이 동작하지 않게되고, 그 결과 Event가 발생하지 않게됩니다.
Event의 취소가능 여부는 event.cancelable를 사용해서 확인할 수 있습니다. 취소불가능한 Event에 대해서 preventDefault를 호출해도 결과는 없습니다.
preventDefault는 DOM을 통한 Event의 전파를 막지않습니다. 전파를 막을때는 event.stopPropagation()를 사용해주세요.

- event.stopPropagation()
Event Bubbling에과 Capturing에 있어 현재 Event 이후의 전파를 막습니다.
모든 Event는 기본적으로 bubble 속성을 가지고 있습니다. 그러므로, 전파를 막기 위한 event.cancelable 속성의 변경을 통해서도 Bubbling에 의한 이벤트 전파를 막을 수 있습니다.

Capturing에 관련된 속성이 없는 이유는, Capturing은 Bubbling처럼 기본적인 속성이 아닙니다.
즉, 개발자에 의해 Capturing 이벤트가 주어졌을 떄, 전파가 방지되야하는 곳에 해당 메소드를 선언하면 쉽게 해결할 수 있습니다..

해당 메소드는 BubblingAndCapturing에서 더 알아보도록 하겠습니다.

References

HTML - Dom : Event
HTML - Dom : Event Type
HTML - Dom : addEventListener

js/advanced/Scope.html.body:
Javascript, Scope?
스코프는 자바스크립트 내에서 변수나 함수, 혹은 객체에 대한 범위를 지정해주기 위해 사용됩니다.
JavaScript(ES6)는 Function level과 Block Level, Lexical Scope 규칙을 따릅니다.
이러한 스코프 영역에 알고가기 위해서는 변수에 대해서 읽어보고 오시기 바랍니다.
Scope
자바스크립트에서 스코프란 어떤 변수들에 접근할 수 있는지를 정의합니다. 스코프엔 두 가지 종류가 있는데, 전역 스코프(global scope)와 지역 스코프(local scope)가 있습니다.
1. Function Level Scope
자바스크립트에서 var키워드로 선언된 변수나, 함수 선언식으로 만들어진 함수는 함수 레벨 스코프를 갖습니다. 즉, 함수 내부 전체에서 유효한 식별자가 됩니다.
아래 코드는 아무런 문제없이 blue를 출력한다.
function printScope() {
    if (true) {
        var color = 'blue';
    }
    console.log(color); // blue
}
printScope();

변수 선언에 사용되는 var는 함수 레벨 스코프 속성을 가지고 있기 때문에 printScope 함수 내부 어디에서든 color를 에러없이 참조할 수 있게 되는 것입니다.
하지만, 함수가 종료되면 함수형 스코프도 같이 종료되기 때문에, 아래와 같은 경우는 not defined가 출력됩니다.
function printScope() {
    var color = 'blue';
}
printScope();
console.log(color); // not defined

2. Block Level Scope
자바스크립트는 전통적으로 함수 레벨 스코프를 지원해왔고, 얼마 전까지만 해도 블록 레벨 스코프는 지원하지 않았습니다. 하지만 가장 최신 명세인 ES6(ECMA 6)부터 블록 레벨 스코프를 지원하기 시작했습니다.
function printScope() {
    if (true) {
        let letBlock = 'let';
        const constBlock = 'const';
    }
    console.log(letBlock); // letBlock is not defined
    console.log(constBlock); // blockColor is not defined
}
printScope();

var와는 다르게 블록 스코프는 block({})     내부에서만 유효하기 때문에 if문이 끝날 때 파괴되어, 해당 값을 참조하여 사용할 경우 not defined 에러메세지를 보게 됩니다.
3. Lexical Scope
랙시컬 스코프는 어휘적 유효 범위라는 의미로 사용됩니다.
간단하게 설명하면, 어떠한 함수가 가지는 유효 범위를 동적으로 가진다는 이야기가 됩니다. MDN 예제를 같이 보도록 합시다.
function globalFunction() {
        // name is a local variable created by globalFunction
        var name = "Seolhun";
        // localFunction() is the inner function, a closure
    function localFunction() {
                // localFunction() uses variable declared in the parent function
        alert (name);
    }
    localFunction();
}
globalFunction(); // alert => "Seolhun"

name이란 변수와 localFunction은 globalrFunction에 의해 생성됩니다.
중요한 것은, localFunction은 자신의 함수형 스코프 밖에 있는 name에 접근할 수 있는 것입니다.
이 부분이 바로 Lexical Scope라고 할 수 있습니다. 현재 어휘적 유효 범위가 동적으로 결정되는 것입니다.
즉, 중첩된 함수들에서 내부함수의 유효 범위는 외부 함수 유효 범위에서 선언된 변수들에 접근할 권한을 가질 수 있다는 것입니다.
Lexical Scope는 Closure와 매우 연관이 깊은데, 현재 함수의 유효적 범위를 외부에서 참조할 수 있게 기억하고 있는 것입니다.
- Hoisting
호이스팅은 끌어올린다는 의미처럼, 변수 및 함수 선언은 컴파일 단계에서 메모리에 저장되어 이를 끌어올린 것처럼 사용할 수 있습니다.
가끔씩, 호이스팅을 변수 및 함수 선언이 물리적으로 작성한 코드의 상단으로 옮겨지는 것으로 가르치지만, 실제로는 그렇지 않고 코드에서 입력한 위치와 정확히 일치한 곳에 있습니다.
printName("Seolhun");
console.log(varName);
console.log(letName);
console.log(constName);

function printName(name) {
  console.log("My name is " + name);
}
var varName = 'Var'; // undefined
let letName = 'Let'; // not defined
const constName = 'Const'; // not defined

위의 예제에서 알 수 있듯이, 함수와 변수 선언(var)은 호이스팅되었음을 알 수 있습니다.
변수를 보면 알수 있듯이 선언만 호이스팅이 되기 때문에 var 변수는 undefined를 출력하게 됩니다.
실질적으로는 let도 호이스팅이 되지만, 참조할 경우 temporal dead zone으로 인해 not defined를 보게 됩니다. const는 호이스팅되지 않습니다.

Temporal dead zone and errors with let
In ECMAScript 2015, let will hoist the variable to the top of the block. However, referencing the variable in the block before the variable declaration results in a ReferenceError. The variable is in a "temporal dead zone" from the start of the block until the declaration is processed.

Summary

var는 함수형 스코프를 가집니다.
let과 const는 블록 스코프를 가집니다.
함수형 스코프와 블록 스코프의 차이는 스코프의 범위입니다.
함수와 변수 선언은 호이스팅되어, 같은 스코프 안에서 위에서 선언된 것처럼 참조하여 사용할 수 있습니다. (우리가 참조하는 것은 컴파일 되어 메모리에 저장된 참조 값이기 때문입니다.)
var는 선언이 호이스팅되며 참조할 수 있습니다. 하지만, undefined입니다.
블록 스코프는 let은 호이스팅되지만 참조할 수 없으며, const는 호이스팅, 참조 둘다 되지 않습니다.


렉시컬 스코프는 클로저와 매우 연관이 깊으며, 현재 어휘의 유효 범위를 의미합니다.

Outro
기본적으로 자바스크립트는 ECMAScript 언어 명세를 따르고 있습니다. Scope에 관련된 내용을 참고하고 싶으신 분들은 ECMA - 명세 8장의 실행코드와 실행컨텍스트 부분에서 동작 방식을 확인할 수 있습니다.
References

ECMA - Executable Code and Execution Contexts
TOAST - 자바스크립트의 스코프와 클로저
MDN - Hoistring
MDN - Closure

